import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { MenuItems } from "./functionNAVIGATION";
import './null.scss';
import './sidebarMenu.scss';

export const SidebarMenu = () => {
   const menuSidebar = [
      { value: "Бестселлеры", url: '#' },
      { value: "Новинки", url: '#' },
      { value: "Нехудожественная литература", url: '#' },
      { value: "Художественная литература", url: '#' },
      { value: "Детская литература", url: '#' },
      { value: "Бизнесс литература", url: '#' },
      { value: "Учебная литература", url: '#' },
      { value: "Психология", url: '#' },
      { value: "Комиксы и манга", url: '#' },
      { value: "Изучение иностранных языков", url: '#' },
      { value: "Медицина", url: '#' },
      { value: "Кулинария и напитки", url: '#' },
      { value: "Красота, здоровья, спорт", url: '#' },
      { value: "Кулинария и напитки", url: '#' },
      { value: "Компьютеры и интернет", url: '#' },

   ];


   return (
      <Router>
   
         <aside className="sidebarMenu">
         <MenuItems props={menuSidebar}/>
      </aside>
      
       
      </Router>
   )
}

